package 初级算法.字符串;

import java.util.HashMap;
import java.util.Map;
import java.util.Set;

/**
 * @Description:
 * @Auther: whw
 * @Date: 2021/12/14
 * @Week: 星期二
 *
 *
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 *
 * 注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
 *
 * 输入: s = "anagram", t = "nagaram"
 * 输出: true
 *
 * 1 <= s.length, t.length <= 5 * 104
 * s 和 t 仅包含小写字母
 *
 * https://leetcode-cn.com/leetbook/read/top-interview-questions-easy/xn96us/
 */
public class 有效的字母异位词 {

    public static void main(String[] args) {
        String s = "rat";
        String t = "ratc";
//        String s = "anagram";
//        String t = "nagaram";
//        String s = "";
//        String t = "";
        boolean res = false;
        long start = 0;
        long end = 0;
        start = System.currentTimeMillis();
        for(int i=0; i<1; i++){

            res = isAnagram(s, t);

        }
        end = System.currentTimeMillis();
        System.out.println(res);
        System.out.println("总用时: " + (end-start) + "ms");
    }


    // 计数法, 0->1:出现新字符 1->0:抵消新字符
    // 0->-1:(由于字符长度要保证相等, 若最后存在-1, 必定有对应的其他字符存在1, 也就count>0)
    public static boolean isAnagram(String s, String t){
        if (s.length() != t.length())
            return false;
        char[] cs = s.toCharArray();
        char[] ct = t.toCharArray();
        int[] map = new int[26];
        int count = 0;
        for (int i = 0; i < cs.length; i++) {
            //出现了一个新的字符
            if (++map[cs[i] - 'a'] == 1) {
                count++;
            }
            //消失了一个新的字符
            if (--map[ct[i] - 'a'] == 0) {
                count--;
            }
        }
        return count == 0;
    }


    // 利用ASCII编码规律法
    // 1.数组统计每一个字符出现的字数
    // 2.比较两个数组是否相等
    public static boolean isAnagram3(String s, String t) {
        char[] schar = new char[26];
        char[] tchar = new char[26];
        int len = s.length();
        if(len != t.length())
            return false;
        for(int i=0; i<len; i++){
            schar[s.charAt(i)-'a']++;
            tchar[t.charAt(i)-'a']++;
        }
        for(int i=0; i<26; i++){
            if(schar[i] != tchar[i])
                return false;
        }
        return true;
    }


    // 利用map集合
    // 1.统计每一个字符出现的次数
    // 2.比较字符出现次数是否相同
    public static boolean isAnagram2(String s, String t) {
        Map<Character, Integer> map1 = new HashMap<>();
        Map<Character, Integer> map2 = new HashMap<>();
        int slen = s.length();
        int tlen = t.length();
        if(slen != tlen)
            return false;
        for( int i=0; i<slen; i++){
            map1.put(s.charAt(i), map1.getOrDefault(s.charAt(i), 0) + 1);
            map2.put(t.charAt(i), map2.getOrDefault(t.charAt(i), 0) + 1);
        }
        if(map1.size() != map2.size())
            return false;

        Set<Map.Entry<Character, Integer>> entries = map1.entrySet();
        for (Map.Entry<Character, Integer> entry : entries) {
            if(!entry.getValue().equals(map2.get(entry.getKey()))){
                return false;
            }
        }
        return true;
    }
}






































